import React, { Fragment } from 'react';
import logo from '../logo.svg';
import Img from './Img';
import './App.css';
import Menu from './menu/Menu';
const menuItem = [
  { id: 1, name: 'home'},
  { id: 2, name: 'portfolio'},
  { id: 3, name: 'about us'},
  { id: 4, name: 'price'},
  { id: 5, name: 'contacts'}
];
const App = () => (
<Fragment>
  <Menu items={menuItem}/>
  <Img src={logo}/>
  <Img src={'https://st2.depositphotos.com/2001755/5408/i/450/depositphotos_54081723-stock-photo-beautiful-nature-landscape.jpg'}/>  
</Fragment>
);



export default App;
